import React from 'react'
import Im from '../image/6.jpg'
import Ima from '../image/7.jpg'
import Imag from '../image/12.jpg'
import Imagess from '../image/9.jpg'
import styled from 'styled-components'
const Main = styled.div`
padding:2%;
background-color:rgb(254 255 240);


`
const Container = styled.div`
padding:2%;
background-color:rgb(252 255 214);
justify-content:space-between;
display: flex;
flex-wrap:wrap;

`
const H = styled.h1`
font-size: 3rem;
font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

text-align: center;
margin-top:12%;
span{
color:blue;
}
`
const HH = styled.div`
font-size: 3rem;
text-align: center;
  color:blue;
font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

` 
const Box = styled.div`
flex-basis:10rem;
flex-grow:1;
background-color:#f9f7c2;
img{
width:95%;
height:80%;
margin:2%;
}


`

function Bottom(){
    return(
        <>
<Main>
<H>Our Team</H>
<Container>
<Box>
    <HH>DESIGNER</HH>
    <img src={Im} alt=""/>
</Box>
<Box>
    <HH>PROGRAMMER</HH>
    <img src={Ima} alt=""/>
</Box>
<Box>
    <HH>PROGRAMMER</HH>
    <img src={Imag} alt=""/>
</Box>
<Box>
    <HH>DEBUGGER</HH>
    <img src={Imagess} alt=""/>
</Box>

</Container>
</Main>

        </>
    )
}

export default Bottom
